DROP TABLE IF EXISTS `trace`;
CREATE TABLE `trace` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '密接者姓名',
  `number` varchar(18) DEFAULT NULL COMMENT '身份证号',
  `sex` tinyint(1) DEFAULT NULL COMMENT '性别，0：男 1：女',
  `source` mediumtext CHARACTER SET utf8 COMMENT '接触来源',
  `address` mediumtext CHARACTER SET utf8 COMMENT '隔离地址',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `start_time` datetime DEFAULT NULL COMMENT '隔离开始时间',
  `age` int(3) DEFAULT NULL COMMENT '年龄',
  `phone` varchar(255) DEFAULT NULL COMMENT '电话',
  `isolate_address` mediumtext CHARACTER SET utf8 COMMENT '隔离地址',
  `infection` mediumtext CHARACTER SET utf8 COMMENT '感染源',
  `hospital` mediumtext CHARACTER SET utf8 COMMENT '诊治医院',
  `is_weight` tinyint(1) DEFAULT NULL COMMENT '是否重症，0：否 1：是',
  `symptom` mediumtext CHARACTER SET utf8 COMMENT '症状',
  `remarks` mediumtext CHARACTER SET utf8 COMMENT '备注',
  `hospital_time` date DEFAULT NULL COMMENT '住院时间',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  `update_user` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '更新者',
  `is_patiented` tinyint(1) DEFAULT NULL COMMENT '是否确诊，0：否 1：是',
  `is_traced` tinyint(1) DEFAULT NULL COMMENT '是否是密接',
  `is_cured` tinyint(1) DEFAULT NULL COMMENT '是否治愈',
  `is_deathed` tinyint(1) DEFAULT NULL COMMENT '是否死亡',
  `is_deleted` tinyint(1) DEFAULT NULL COMMENT '是否删除',
  `leave_time` datetime DEFAULT NULL COMMENT '出院时间',
  `situation` mediumtext CHARACTER SET utf8 COMMENT '现状',
  `death_time` datetime DEFAULT NULL COMMENT '死亡时间',
  `death_note` mediumtext CHARACTER SET utf8 COMMENT '死亡备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=latin1;

