  `inoculation_site` mediumtext CHARACTER SET utf8 COMMENT '接种点名称',
  `inoculation_area` mediumtext CHARACTER SET utf8 COMMENT '接种点所在区域',
  `inoculation_address` mediumtext CHARACTER SET utf8 COMMENT '接种点详细地址',
