  `vaccines_type` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '疫苗类别',
  `number` int(10) DEFAULT NULL COMMENT '注射总帧数',
  `vaccines_level` varchar(10) CHARACTER SET utf8 DEFAULT NULL COMMENT '疫苗等级',
